2DAFD8F2-A2F4-409E-8598-B9AB15636FA4.source:
var event;

/**
 * 描述该功能...
 */
function keydown(event) {
  if (event.keyCode === 37) {
      this.position.x += (-0.1)
      this.rotation.z += 0.1
  }
  if (event.keyCode === 39) {
      this.position.x += 0.1
      this.rotation.z += (-0.1)
  }
  if (event.keyCode === 38) {
      this.position.z += (-0.1)
      this.rotation.x += (-0.1)
  }
  if (event.keyCode === 40) {
      this.position.z += 0.1
      this.rotation.x += 0.1
  }
}

